def get_rightmost_index(array, value):
	index = -1
	for i in range(len(array)):
		if array[i] == value:
			index = i
	return index

def remove_duplicates(array):
	unique_array = []
	for i in range(len(array)):
		if array[i] not in unique_array:
			unique_array.append(array[i])
	return unique_array

